I promised some additions to the original example provided so lets start with the easiest one, a simple camera controller. I just want to be able to pan around the simulation and zoom in a bit. I am going to run a cleanup and refactor for readability and cleanliness. Create three new files, camera.rs, input.rs, and utils.rs, along with the a folder pipeline. It is important the pipeline folder is named exactly as the pipeline.rs file as I am not using mod.rs files. Move the function create_image into our utils folder and delete the image file. Inside pipeline folder create a automata.rs file and move all the pipeline code from our past three posts into it. This includes the Pipeline, TextureBindGroup, State, and Node. I also renamed some things. Here is a mapping: Pipeline -> AutomataPipeline GameOfLifeImageBindGroup -> AutomataTextureBindGroup GameOfLifeState -> AutomataState GameOfLifeNode -> AutomataNode Lets add a simple plugin to host from this file at the top: #[derive(Resource, Clone, Deref, ExtractResource)]
pub struct GameOfLifeImage(pub Handle<Image>); pub struct AutomataPipelinePlugin;
impl Plugin for AutomataPipelinePlugin { fn build(&self, render_app: &mut App) { render_app .init_resource::<GameOfLifeAutomataPipeline>() .add_system(queue_automata_bind_group.in_set(RenderSet::Queue)); }
} Back in the pipeline.rs file, it should be empty, so lets add another plugin to host all pipeline plugins. pub struct PipelinesPlugin;
impl Plugin for PipelinesPlugin { fn build(&self, app: &mut App) { let render_app = app.sub_app_mut(RenderApp); render_app .add_plugin(automata::AutomataPipelinePlugin); let mut render_graph = render_app.world.resource_mut::<RenderGraph>(); let gol_id = render_graph.add_node("game_of_life", automata::AutomataNode::default()); /* * Automata Pipeline => Camera Driver */ render_graph.add_node_edge(gol_id, bevy::render::main_graph::node::CAMERA_DRIVER); }
} We are moving the render_app implementation from our ShaderPlaygroundPlugin to this new PipelinesPlugin. Don't forget to add the PipelinesPlugin to the ShaderPlaygroundPlugin in lib.rs!

