Onto setting up a camera controller. const CAMERA_MOVE_SPEED: f32 = 500.0; pub struct CameraPlugin;
impl Plugin for CameraPlugin { fn build(&self, app: &mut App) { app.add_system(camera_controller); }
} fn camera_controller( time: Res<Time>, keyboard_input: Res<Input<KeyCode>>, mut mouse_wheel_events: EventReader<MouseWheel>, mut query: Query<(&mut Transform, &mut OrthographicProjection), With<Camera>>,
) { for (mut transform, mut ortho) in query.iter_mut() { let up = keyboard_input.pressed(KeyCode::W); let down = keyboard_input.pressed(KeyCode::S); let left = keyboard_input.pressed(KeyCode::A); let right = keyboard_input.pressed(KeyCode::D); let x_axis = right as i8 - left as i8; let y_axis = up as i8 - down as i8; let mut move_delta = Vec2::new(x_axis as f32, y_axis as f32); // =========== Move the camera around =========== // if move_delta != Vec2::ZERO { move_delta /= move_delta.length(); let z = transform.translation.z; transform.translation += move_delta.extend(z) * CAMERA_MOVE_SPEED * time.delta_seconds(); // Important! We need to restore the Z values when moving the camera around. // Bevy has a specific camera setup and this can mess with how our layers are shown. transform.translation.z = z; } // =========== Zoom =========== // for MouseWheel { x, y, unit } in mouse_wheel_events.iter() { let mut x_scroll_diff = 0.0; let mut y_scroll_diff = 0.0; match unit { MouseScrollUnit::Line => { x_scroll_diff += x; y_scroll_diff += y; } MouseScrollUnit::Pixel => { // I just took this from three-rs, no idea why this magic number was chosen ¯\_(ツ)_/¯ const PIXELS_PER_LINE: f32 = 38.0; y_scroll_diff += y / PIXELS_PER_LINE; x_scroll_diff += x / PIXELS_PER_LINE; } } if x_scroll_diff != 0.0 || y_scroll_diff != 0.0 { if y_scroll_diff < 0.0 { ortho.scale *= 1.05; } else { ortho.scale *= 1.0 / 1.05; } ortho.scale = ortho.scale.clamp(0.15, 5.); } } }
}
... // in our ShaderPlaygroundPlugin app // Extract the game of life image resource from the main world into the render world // for operation on by the compute shader and display on the sprite. .add_plugin(ExtractResourcePlugin::<GameOfLifeImage>::default()) .add_plugin(camera::CameraPlugin) .add_startup_system(setup);
... A simple camera controller. We generate a move delta based on the pressed keys and then using bevy's builtin time resource, manipulate the camera's position for buttery smooth movement. Adjust the movement constant to your liking. The zoom just listens for scroll events and adjusts the orthographic projection's scale. The MouseScrollUnit::Pixel case is taken from an online example I found. I don't know what triggers a MouseScrollUnit::Pixel, but I have only seen Line units so far, but better safe than sorry! To better see that our camera works well, you can replace the ClearColor(Color::BLACK) with ClearColor(Color::WHITE). You should now be able to pan around the simulation and also zoom! camera The main thing I want this part to focus on would be drawing onto our canvas. We will be using ANOTHER ;) compute pipeline to handle this for us. Lets setup the mouse positioning system that will be used. Setting up our input bindings lets fill out input.rs file. We need a resource to hold our mouse position, previous mouse position, and if our mouse button is down. pub struct InputPlugin;
impl Plugin for InputPlugin { fn build(&self, app: &mut App) { app.init_resource::<AutomataParams>(); }
} #[derive(Default, Resource, ExtractResource, Clone)]
pub struct AutomataParams { pub mouse_pos: Vec2, pub is_drawing: bool, pub prev_mouse_pos: Vec2,
} pub fn update_input_state( window_query: Query<&Window>, mut input_state: ResMut<AutomataParams>, camera_q: Query<(&Camera, &GlobalTransform)>, mut mouse_button_input_events: EventReader<MouseButtonInput>,
) { let Ok(primary_window) = window_query.get_single() else { return }; // get the camera info and transform let Ok((camera, camera_transform)) = camera_q.get_single() else { return }; // Determine button state for event in mouse_button_input_events.iter() { if event.button == MouseButton::Left { input_state.is_drawing = event.state == ButtonState::Pressed; } } ...
} Mouse button is a simple event reader. The previous and current mouse position is a bit more complicated as we need to convert from world space to canvas space. if let Some(world_position) = primary_window .cursor_position() .and_then(|cursor| camera.viewport_to_world(camera_transform, cursor)) .map(|ray| ray.origin.truncate())
{
} Grabbing the world_position from the window and camera is ripped from the bevy cheatbook . Now that we have the world coordinates, we need a way to transform them into curstor coordinates. In utils add a function: use bevy::prelude::Vec2; pub fn world_pos_to_canvas_pos(world_pos: Vec2) -> Vec2 { world_pos + Vec2::new( crate::SIM_SIZE.0 as f32 / 2.0, crate::SIM_SIZE.1 as f32 / 2.0, )
} This just takes the world position and adds half the size of the canvas to it. Finish off the input system. if let Some(world_position) = primary_window .cursor_position() .and_then(|cursor| camera.viewport_to_world(camera_transform, cursor)) .map(|ray| ray.origin.truncate())
{ params.prev_mouse_pos = params.mouse_pos; // NEW params.mouse_pos = crate::utils::world_pos_to_canvas_pos(world_position * Vec2::new(1.0, -1.0)); // NEW
} world_position * Vec2::new(1.0, -1.0) is just flipping the y axis since images have y going down and wgpu has y going up. Add the input plugin to the ShaderPlaygroundPlugin along with the ExtractResourcePlugin ...
