We are going to need bytemuck so add that to your project with cargo add bytemuck. Add a new file in pipeline folder called draw. This is going to look really similar to the automata setup, just with a few minor tweaks. pub struct AutomataDrawPipelinePlugin;
impl Plugin for AutomataDrawPipelinePlugin { fn build(&self, render_app: &mut App) { render_app .init_resource::<AutomataDrawPipeline>() .add_system(queue_draw_bind_group.in_set(RenderSet::Queue)); }
} // ================================== Constants ================================== // #[repr(C)]
#[derive(Copy, Clone, bytemuck::Pod, bytemuck::Zeroable)]
pub struct AutomataPushConstants { draw_start: [f32; 2], draw_end: [f32; 2], draw_radius: f32,
} impl AutomataPushConstants { pub fn new(draw_start: Vec2, draw_end: Vec2, draw_radius: f32) -> Self { Self { draw_radius, draw_end: draw_end.to_array(), draw_start: draw_start.to_array(), } }
} This new struct holds our push constants that we will pass to our draw pipeline shader. PushConstants are a way to pass data to a shader without having to create a buffer. The downside is that the data is limited and is much smaller than the limit on buffers. The upside is that it is faster than buffers. // ================================== Pipeline ================================== // #[derive(Resource)]
pub struct AutomataDrawPipeline { draw_pipeline: CachedComputePipelineId, draw_bind_group_layout: BindGroupLayout,
} impl FromWorld for AutomataDrawPipeline { fn from_world(world: &mut World) -> Self { let pipeline_cache = world.resource::<PipelineCache>(); let draw_bind_group_layout = world .resource::<RenderDevice>() .create_bind_group_layout(&BindGroupLayoutDescriptor { label: Some("Game of Life Bind Group Layout"), entries: &[BindGroupLayoutEntry { binding: 0, visibility: ShaderStages::COMPUTE, ty: BindingType::StorageTexture { access: StorageTextureAccess::ReadWrite, format: TextureFormat::Rgba8Unorm, view_dimension: TextureViewDimension::D2, }, count: None, }], }); let brush_shader = world.resource::<AssetServer>().load("shaders/draw.wgsl"); let draw_pipeline = pipeline_cache.queue_compute_pipeline(ComputePipelineDescriptor { shader: brush_shader, shader_defs: vec![], entry_point: Cow::from("draw"), layout: vec![draw_bind_group_layout.clone()], label: Some(std::borrow::Cow::Borrowed("Game of Life Draw Pipeline")), push_constant_ranges: [PushConstantRange { stages: ShaderStages::COMPUTE, range: 0..std::mem::size_of::<AutomataPushConstants>() as u32, }] .to_vec(), }); AutomataDrawPipeline { draw_pipeline, draw_bind_group_layout, } }
} Our draw_pipeline has a new value: push_constant_ranges. The push_constant_ranges is a range of bytes that can be passed to the shader via PushConstants. // ================================== BindGroup ================================== // #[derive(Resource)]
struct AutomataDrawBindGroup(pub BindGroup); pub fn queue_draw_bind_group( mut commands: Commands, render_device: Res<RenderDevice>, pipeline: Res<AutomataDrawPipeline>, gpu_images: Res<RenderAssets<Image>>, game_of_life_image: Res<GameOfLifeImage>,
) { let view = &gpu_images[&game_of_life_image.0]; let draw_bind_group = render_device.create_bind_group(&BindGroupDescriptor { label: Some("Game of Life Draw Bind Group"), layout: &pipeline.draw_bind_group_layout, entries: &[BindGroupEntry { binding: 0, resource: BindingResource::TextureView(&view.texture_view), }], }); commands.insert_resource(AutomataDrawBindGroup(draw_bind_group));
} // ================================== Nodes ================================== //
pub enum AutomataDrawState { Loading, Update,
} pub struct AutomataDrawNode { state: AutomataDrawState,
} impl Default for AutomataDrawNode { fn default() -> Self { Self { state: AutomataDrawState::Loading, } }
} Our node only has two states: Loading and Update as we don't need to initialize anything. impl render_graph::Node for AutomataDrawNode { fn update(&mut self, world: &mut World) { let pipeline_cache = world.resource::<PipelineCache>(); let pipeline = world.resource::<AutomataDrawPipeline>(); // if the corresponding pipeline has loaded, transition to the next stage match self.state { AutomataDrawState::Loading => { if let CachedPipelineState::Ok(_) = pipeline_cache.get_compute_pipeline_state(pipeline.draw_pipeline) { self.state = AutomataDrawState::Update; } } AutomataDrawState::Update => {} } } fn run( &self, _graph: &mut render_graph::RenderGraphContext, render_context: &mut RenderContext, world: &World, ) -> Result<(), render_graph::NodeRunError> { let params = &world.resource::<AutomataParams>(); if params.is_drawing { let texture_bind_group = &world.resource::<AutomataTextureBindGroup>().0; let draw_bind_group = &world.resource::<AutomataDrawBindGroup>().0; let pipeline_cache = world.resource::<PipelineCache>(); let pipeline = world.resource::<AutomataDrawPipeline>(); let mut pass = render_context .command_encoder() .begin_compute_pass(&ComputePassDescriptor::default()); pass.set_bind_group(0, texture_bind_group, &[]); // select the pipeline based on the current state match self.state { AutomataDrawState::Loading => {} AutomataDrawState::Update => { let draw_pipeline = pipeline_cache .get_compute_pipeline(pipeline.draw_pipeline) .unwrap(); let pc = AutomataPushConstants::new(params.mouse_pos, params.prev_mouse_pos, 10.0); pass.set_pipeline(draw_pipeline); pass.set_bind_group(0, draw_bind_group, &[]); pass.set_push_constants(0, bytemuck::cast_slice(&[pc])); pass.dispatch_workgroups( SIM_SIZE.0 / WORKGROUP_SIZE, SIM_SIZE.1 / WORKGROUP_SIZE, 1, ); } } } Ok(()) }
} Inside our run, we first check to see if we are drawing at all. If so, we pull the current mouse position as well as the previous mouse position and instantiate the AutomataPushConstants with a radius of 10.0. We then setup the pipeline and add the push constants with bytemuck::cast_slice. With that, our draw pipeline is complete and ready. Lets add it to our pipelines plugin: impl Plugin for PipelinesPlugin { fn build(&self, app: &mut App) { let render_app = app.sub_app_mut(RenderApp); render_app .add_plugin(draw::AutomataDrawPipelinePlugin) .add_plugin(automata::AutomataPipelinePlugin); let mut render_graph = render_app.world.resource_mut::<RenderGraph>(); let gol_id = render_graph.add_node("game_of_life", automata::AutomataNode::default()); let draw_id = render_graph.add_node("game_of_life_draw", draw::AutomataDrawNode::default()); ... We now have a new node to use in our render graph! We want the draw_node to run before our automata_node. let mut render_graph = render_app.world.resource_mut::<RenderGraph>();
let gol_id = render_graph.add_node("game_of_life", automata::AutomataNode::default());
let draw_id = render_graph.add_node("game_of_life_draw", draw::AutomataDrawNode::default()); /*
* Draw Pipeline => Automata Pipeline => Camera Driver
*/
render_graph.add_node_edge(draw_id, gol_id);
render_graph.add_node_edge(gol_id, bevy::render::main_graph::node::CAMERA_DRIVER); This creates a new edge from the draw_node to the automata_node and then from the automata_node to the camera_driver! Onto the draw shader!!

