create a file called draw.wgsl in our shaders folder and add the following starter code: struct PushConstants { draw_start: vec2<f32>, draw_end: vec2<f32>, draw_radius: f32,
}
var<push_constant> pc: PushConstants; @group(0) @binding(0)
var texture: texture_storage_2d<rgba8unorm, read_write>; @compute @workgroup_size(8, 8, 1)
fn draw(@builtin(global_invocation_id) invocation_id: vec3<u32>)
{ let pixel = vec2<u32>(invocation_id.xy); let size = vec2<u32>(textureDimensions(texture)); if (pixel.x >= size.x && pixel.y >= size.y) { return ; } // Draw circle if (pc.draw_radius > 0.0) { }
} This is all familiar except for the new push_contant and a new function: textureDimensions. The push_contant variable should match what we are passing from rust side of things. We are passing in the start and end of the mouse position as well as the radius of the circle we want to draw. textureDimensions function returns the dimensions of the texture we are sampling from.We use this to check if the current pixel is outside of the texture bounds. Now we pass in a start and end position, so we need to generate a line between these two points. Searching the web I found the following stackoverflow thread with many examples: shortest-distance-between-a-point-and-a-line-segment // Line v->w, point p
// https://stackoverflow.com/questions/849211/shortest-distance-between-a-point-and-a-line-segment
fn closest_point_on_line(v: vec2<f32>, w: vec2<f32>, p: vec2<f32>) -> vec2<f32> { let c = v - w; // length squared let l2 = dot(c, c); if (l2 == 0.0) { return v; } let t = max(0.0, min(1.0, dot(p - v, w - v) / l2)); let projection = v + t * (w - v); return projection;
} Challenge: Feel free to scower the web for your own implementation and try replacing my implementation with yours! Using this in our draw function: // Draw circle if (pc.draw_radius > 0.0) { let pos = vec2<f32>(pixel); let point_on_line = closest_point_on_line(pc.draw_start, pc.draw_end, pos); } We need to cast our pixel variable to an f32 to be used by our closest_point_on_line function. We can now use this point to draw with. Add a new function for drawing a circle: fn draw_particle_circle(pos: vec2<f32>, draw_pos: vec2<f32>, radius: f32) { let y_start = draw_pos.y - radius; let y_end = draw_pos.y + radius; let x_start = draw_pos.x - radius; let x_end = draw_pos.x + radius; if (pos.x >= x_start && pos.x <= x_end && pos.y >= y_start && pos.y <= y_end) { let diff = pos - draw_pos; let dist = length(diff); if (round(dist) <= radius) { textureStore(texture, vec2<i32>(pos), vec4<f32>(1.0, 1.0, 1.0, 1.0)); } }
} This looks pretty similar to how you would draw a circle on the rust side. We create a bounding box based on the radius and make sure our click position falls within that box. If it does, we calculate the distance from the click position to the current pixel and if that distance is less than or equal to the radius, we store an alive cell at that position. (remember our alive cells are marked by a 1.0 value in the r channel of the pixel color). Finish off our shader: // Draw circle
if (pc.draw_radius > 0.0) { let pos = vec2<f32>(pixel); let point_on_line = closest_point_on_line(pc.draw_start, pc.draw_end, pos); draw_particle_circle(pos, point_on_line, pc.draw_radius);
}

