Before we continue with the graphical side of things, let's add some UI to our game. I prefer to use egui in my projects, and there is a wonderful integration crate for bevy bevy_egui . Let's add it to our project. $ cargo add bevy_egui Our UI will be pretty simplicstic for now. We will show the base simulation properties, and a couple of overridable properties. We are going to quickly add some new properties that we will use. pub struct AutomataParams { pub is_paused: bool, // NEW pub is_drawing: bool, pub can_scroll: bool, // NEW pub use_square_brush: bool, // NEW pub radius: f32, // NEW pub mouse_pos: Vec2, pub prev_mouse_pos: Vec2,
} impl Default for AutomataParams { fn default() -> Self { Self { is_paused: false, // NEW can_scroll: true, // NEW is_drawing: false, use_square_brush: true, // NEW radius: 4.0, // NEW mouse_pos: Vec2::ZERO, prev_mouse_pos: Vec2::ZERO, } }
} Now lets build our UI! const SPACING: f32 = 10.0;
const TEXT_SIZE: f32 = 15.0;
const HEADING_SIZE: f32 = 20.0; #[bevy_plugin]
pub fn UIPlugin(app: &mut App) { app.add_plugin(EguiPlugin).add_system(user_interface); // Remember to add the EguiPlugin
} /// Give our text a custom size
fn sized_text(ui: &mut Ui, text: impl Into<String>) { ui.label( egui::RichText::new(text) .size(TEXT_SIZE) .color(egui::Color32::WHITE), );
} fn heading(ui: &mut Ui, text: impl Into<String>) { ui.heading( egui::RichText::new(text) .underline() .size(HEADING_SIZE) .color(egui::Color32::WHITE), );
} I am adding a couple of helper methods just to make things easier and reduce the boilerplate I have to write later :D /// System to generate user interface with egui
pub fn user_interface( mut contexts: EguiContexts, mut params: ResMut<AutomataParams>,
) { egui::Window::new("Automata") .constrain(true) .fixed_pos(egui::pos2(10.0, 10.0)) .show(contexts.ctx_mut(), |ui| { ui.visuals_mut().override_text_color = Some(egui::Color32::WHITE); heading(ui, "Info"); ui.add_space(SPACING); sized_text(ui, format!("Grid size: ({},{})", SIM_SIZE.0, SIM_SIZE.1)); sized_text( ui, (if params.is_paused { "Paused" } else { "Simulating" }) .to_string(), ); ui.add_space(SPACING); heading(ui, "Settings"); ui.add_space(SPACING); ui.checkbox(&mut params.use_square_brush, "Square Brush"); ui.add(egui::Slider::new(&mut params.radius, 1.0..=200.0).text("Brush Size")); });
} Our Info section will show the size of our grid, and if our simulation is currently running. The Settings section will allow us to change the brush size and toggle between a square brush or circular brush. Add the plugin to our main plugin, and run the application. This is how it looks: UI Let's hookup these properties to our application so we can actually use them!! In our update_input_state system, we need to check if Egui is currently being hovered, or capturing the mouse. If so, we need to disable certain inputs from happening while the UI is active. pub fn update_input_state( mut contexts: EguiContexts, window_query: Query<&Window>, mut params: ResMut<AutomataParams>, keyboard_input: Res<Input<KeyCode>>, camera_q: Query<(&Camera, &GlobalTransform)>, mut mouse_button_input_events: EventReader<MouseButtonInput>,
) { let Ok(primary_window) = window_query.get_single() else { return }; // get the camera info and transform let Ok((camera, camera_transform)) = camera_q.get_single() else { return }; let ctx = contexts.ctx_mut(); if ctx.wants_pointer_input() || ctx.is_pointer_over_area() || ctx.is_using_pointer() || ctx.wants_pointer_input() { // GUI gets priority input params.is_drawing = false; params.can_scroll = false; return; } else { params.can_scroll = true; }
... Essentiall, if the UI is currently using the mouse, we don't want to allow the user to draw on the grid, or scroll the camera. Now we can hookup our is_paused property to our simulation. We will do this in the update_simulation system. ...
// Pause the simulation
if keyboard_input.just_pressed(KeyCode::Space) { params.is_paused = !params.is_paused;
}
... Feel free to use whatever KeyCode you wish, but we just flip the simulation run state when the user presses the spacebar. Quickly flipping to our camera_controller system, we can disable scroll events based on our new property. pub fn camera_controller( time: Res<Time>, params: Res<AutomataParams>, // NEW keyboard_input: Res<Input<KeyCode>>, mut mouse_wheel_events: EventReader<MouseWheel>, mut query: Query<(&mut Transform, &mut OrthographicProjection), With<Camera>>,
)
...
// =========== Zoom =========== //
if params.can_scroll { // NEW // zoom code
} In our automata pipeline, we can disable the pipeline if the simulation is paused. fn run( &self, _graph: &mut render_graph::RenderGraphContext, render_context: &mut RenderContext, world: &World,
) -> Result<(), render_graph::NodeRunError> { let is_paused = &world.resource::<AutomataParams>().is_paused; if !is_paused { // run the init / update pipelines } Ok(())
} And finally, we can use the two new params in our AutomataPushConstants for our draw_pipeline. pub struct AutomataPushConstants { draw_start: [f32; 2], draw_end: [f32; 2], draw_radius: f32, draw_square: u32, // NEW
} impl AutomataPushConstants { pub fn new(draw_start: Vec2, draw_end: Vec2, draw_radius: f32, draw_square: bool) -> Self { Self { draw_radius, draw_end: draw_end.to_array(), draw_square: draw_square as u32, // NEW draw_start: draw_start.to_array(), } }
} ... let pc = AutomataPushConstants::new( params.mouse_pos, params.prev_mouse_pos, params.radius, // NEW params.use_square_brush, // NEW
);
