A buffer is a blob of data on the GPU. A buffer is guaranteed to be contiguous, meaning that all the data is stored sequentially in memory. Buffers are generally used to store simple things like structs or arrays, but they can store more complex stuff such as graph structures like trees (provided all the nodes are stored together and don't reference anything outside of the buffer) To get started, we are going to add a Uniform buffer for our simulation size, instead of querying the texture each time. This is a pretty simplicstic example for a uniform buffer, but it will help us understand the basics. Uniform Buffers A uniform is a blob of data that is available to every invocation of a set of shaders. We've technically already used uniforms for our texture and sampler. Uniform buffers are great for small, read only data Add a helper method to our utils.rs file: pub fn create_uniform_buffer<T: bytemuck::Pod + bytemuck::Zeroable>( device: &RenderDevice, data: &[T], label: Option<&str>,
) -> Buffer { device.create_buffer_with_data(&BufferInitDescriptor { label, contents: bytemuck::cast_slice(data), usage: BufferUsages::UNIFORM | BufferUsages::COPY_DST, })
} We using our handy dandy RenderDevice to create a buffer with initial data. The contents has to be &[u8] so we use bytemuck to cast our data to bytes. Notice the buffer usage. UNIFORM because this will be a uniform buffer and COPY_DST allows a buffer to be the destination buffer for a CommandEncoder::copy_buffer_to_buffer, CommandEncoder::copy_texture_to_buffer, CommandEncoder::clear_buffer or Queue::write_buffer operation. Over in our setup system where we create our image, lets also add our buffers. // NEW
