const WORKGROUP_SIZE: u32 = 8; pub struct ShaderPlaygroundPlugin;
impl Plugin for ShaderPlaygroundPlugin { fn build(&self, app: &mut App) { app.add_plugin(FrameTimeDiagnosticsPlugin::default()) .add_system(window_fps); }
} fn window_fps(diagnostics: Res<Diagnostics>, mut windows: Query<&mut Window, With<PrimaryWindow>>) { if let Ok(mut window) = windows.get_single_mut() { if let Some(fps_diagnostic) = diagnostics.get(FrameTimeDiagnosticsPlugin::FPS) { if let Some(fps_smoothed) = fps_diagnostic.smoothed() { window.title = format!("{fps_smoothed:.2}"); } } }
} Pretty simple setup. Just added a simple fps system to print the FPS at the top of the window. We need to setup our canvas for our simulation. We will just use a simple image constrained to our SIM_SIZE variable. You can organize your code how you feel, but I will be breaking out the code from the original example into separate files for readability. // image.rs #[derive(Resource, Clone, Deref, ExtractResource)]
pub struct GameOfLifeImage(pub Handle<Image>); pub fn create_image(width: u32, height: u32) -> Image { let mut image = Image::new_fill( Extent3d { width, height, depth_or_array_layers: 1, }, TextureDimension::D2, &[0, 0, 0, 255], TextureFormat::Rgba8Unorm, ); image.texture_descriptor.usage = TextureUsages::COPY_DST | TextureUsages::STORAGE_BINDING | TextureUsages::TEXTURE_BINDING; image
} This is just a simple helper function to create an image. We will be using this to create our simulation image. GameOfLifeImage will hold a reference to our handle image so that it doesn't get unloaded. You will see it is annotated with ExtractResource derive. This is required to extract the image from the main bevy world into the render world. You can also manually derive this, if needed. Lets use it within our setup function. Back in lib.rs: ...
fn setup(mut commands: Commands, mut images: ResMut<Assets<Image>>) { let image = image::create_image(SIM_SIZE.0, SIM_SIZE.1); let image = images.add(image); commands.spawn(SpriteBundle { sprite: Sprite { custom_size: Some(Vec2::new(SIM_SIZE.0 as f32, SIM_SIZE.1 as f32)), ..default() }, texture: image.clone(), ..default() }); commands.spawn(Camera2dBundle::default()); commands.insert_resource(image::GameOfLifeImage(image));
} Quick and easy. Just create our image, create a sprite based off the image, spawn a 2D camera, and then inject our resource into bevy world. Now we just need to hookup our system back in the plugin. fn build(&self, app: &mut App) { app.add_plugin(FrameTimeDiagnosticsPlugin::default()) .add_startup_system(setup) .add_system(window_fps);
} Running the simulation should produce a black screen and nothing more. But hey! No errors! Lets move on. As mentioned earlier, bevy has a render world which is extracted each render instance. We need to tell our render setup how to access members from the main world. In our plugin, add the ExtractResourcePlugin for our GameOfLifeImage resource. ...
// Extract the game of life image resource from the main world into the render world
// for operation on by the compute shader and display on the sprite.
app.add_plugin(ExtractResourcePlugin::<GameOfLifeImage>::default());
... Now onto the actual meat of why I am writing this. Lets get into wgpu. We will be using a compute shader, so our pipeline will need to be a ComputePipeline. A pipeline describes all the actions the gpu will perform when acting on a set of data Lets create a new file, pipeline.rs and add the following: use bevy::{prelude::*, render::render_resource::*}; #[derive(Resource)]
pub struct GameOfLifePipeline { init_pipeline: CachedComputePipelineId, update_pipeline: CachedComputePipelineId, texture_bind_group_layout: BindGroupLayout,
} impl FromWorld for GameOfLifePipeline { fn from_world(world: &mut World) -> Self {}
} Our pipeline resource holds the two compute pipeline id's we will be using init (for setup) and update (for each frame). We also need to hold onto the bind group layout. a bind group layout is a way to describe the structure of resources that a shader will access during execution. The resources include buffers, textures, and samplers Lets expand upon our FromWorld implementation. impl FromWorld for GameOfLifePipeline { fn from_world(world: &mut World) -> Self { let texture_bind_group_layout = world .resource::<RenderDevice>() .create_bind_group_layout(&BindGroupLayoutDescriptor { label: Some("Game of Life Bind Group Layout"), entries: &[BindGroupLayoutEntry { binding: 0, visibility: ShaderStages::COMPUTE, ty: BindingType::StorageTexture { access: StorageTextureAccess::ReadWrite, format: TextureFormat::Rgba8Unorm, view_dimension: TextureViewDimension::D2, }, count: None, }], }); let pipeline_cache = world.resource::<PipelineCache>(); let shader = world .resource::<AssetServer>() .load("shaders/game_of_life.wgsl"); ... WHOA! What is this weird layout stuff? First thing first, the RenderDevice is equivalent to wgpu::Device. We are just using the bevy wrapper. I like to add labels to all my shader creations, just to make it easier to track bugs when they do arise. This layout is telling the pipeline that at binding(0) we expect there to be a binding of type StorageTexture, that is read_write, and has the format of Rgba8Unorm. We then pull the pipeline cache to create our pipelines and pull our shader from the asset's folder.

6.body:
A compute shader is simply a shader that allows you to leverage the GPU's parallel computing power for arbitrary tasks. You can use them for anything from creating a texture to running a neural network. I'll get more into how they work in a bit, but for now suffice to say that we're going to use them to create the vertex and index buffers for our terrain. As of writing, compute shaders are still experimental on the web. You can enable them on beta versions of browsers such as Chrome Canary and Firefox Nightly. Because of this I'll cover a method to use a fragment shader to compute the vertex and index buffers after we cover the compute shader method. let init_pipeline = pipeline_cache.queue_compute_pipeline(ComputePipelineDescriptor { shader: shader.clone(), shader_defs: vec![], layout: vec![texture_bind_group_layout.clone()], entry_point: Cow::from("init"), push_constant_ranges: Vec::new(), label: Some(std::borrow::Cow::Borrowed("Game of Life Init Pipeline")), }); let update_pipeline = pipeline_cache.queue_compute_pipeline(ComputePipelineDescriptor { shader, shader_defs: vec![], layout: vec![texture_bind_group_layout.clone()], entry_point: Cow::from("update"), push_constant_ranges: Vec::new(), label: Some(std::borrow::Cow::Borrowed("Game of Life Update Pipeline")), }); GameOfLifePipeline { texture_bind_group_layout, init_pipeline, update_pipeline, } The init and update pipeline use the same layout and shader. We are not using push constants yet, so we can leave that as an empty vector, same with shader_defs. The important part is the entry_point. This is the name of the function in the shader that will be executed. Lets quickly setup our shader and then we can move onto the actual compute shader. // assets/game_of_life.wgsl @group(0) @binding(0)
var texture: texture_storage_2d<rgba8unorm, read_write>; @compute @workgroup_size(8, 8, 1)
fn init(@builtin(global_invocation_id) invocation_id: vec3<u32>, @builtin(num_workgroups) num_workgroups: vec3<u32>) {} @compute @workgroup_size(8, 8, 1)
fn update(@builtin(global_invocation_id) invocation_id: vec3<u32>) {} We can see that from what we defined in our BindGroupLayoutDescriptor that we define a texture_storage_2d<rgba8unorm, read_write> at binding(0). Looking back at our descriptor: BindGroupLayoutDescriptor { label: Some("Game of Life Bind Group Layout"), entries: &[BindGroupLayoutEntry { binding: 0, visibility: ShaderStages::COMPUTE, ty: BindingType::StorageTexture { access: StorageTextureAccess::ReadWrite, format: TextureFormat::Rgba8Unorm, view_dimension: TextureViewDimension::D2, }, count: None, }],
} We see that our BindGroupLayoutEntry matches what we expect at group(0) binding(0). This has to match 1:1, otherwise wgpu will panic on run. Afterwards, we simply just adds our entry points that we defined in the pipeline's. The @workgroup_size is the size of the workgroup that will be executed on the gpu. Bevy example uses 8. Let's add our newly created pipeline resource to the render world. Back in the plugin: ...
let render_app = app.sub_app_mut(RenderApp);
render_app.init_resource::<GameOfLifePipeline>(); Running the example now should produce the same screen, but still no errors. We are getting closer to actually doing something. More in part 2. Code can be found on github: Part 1

7.body:
Now that we have our pipeline descriptors setup, its time to build the bind group. A BindGroup is a collection of resources such as buffers, textures, and samplers that are bound together and made available to shaders during rendering. Bind groups are created by the application and then bound to a specific pipeline layout, which defines the expected bindings for the resources in the group. At the bottom of our pipeline.rs file, lets add the system which will create our bindgroup each render instance. ... #[derive(Resource)]
struct GameOfLifeImageBindGroup(pub BindGroup); pub fn queue_bind_group( mut commands: Commands, render_device: Res<RenderDevice>, pipeline: Res<GameOfLifePipeline>, gpu_images: Res<RenderAssets<Image>>, game_of_life_image: Res<GameOfLifeImage>,
) { let view = &gpu_images[&game_of_life_image.0];
} Starting off we pull in RenderDevice which is used to create all wgpu resources. RenderAssets<Image> is a resource holding all the GPU representations of RenderAssets as long as they exist. We use the handle from the image we created as our canvas, to get the GpuImage. Now the bind group: ...
let bind_group = render_device.create_bind_group(&BindGroupDescriptor { label: Some("Game of Life Bind Group"), layout: &pipeline.texture_bind_group_layout, entries: &[BindGroupEntry { binding: 0, resource: BindingResource::TextureView(&view.texture_view), }],
});
commands.insert_resource(GameOfLifeImageBindGroup(bind_group)); Well this looks really familiar! It is an exact replica of the bind_group_layout we created earlier. The only difference is that we are now adding the actual resources that the layout expects. In this case we are adding the texture view of our canvas image. Lets add the system to our render app. ...
let render_app = app.sub_app_mut(RenderApp); render_app .init_resource::<GameOfLifePipeline>() .add_system(pipeline::queue_bind_group.in_set(RenderSet::Queue)); We add our system to the set RenderSet::Queue which create BindGroups that depend on Prepare data and queue up draw calls to run during the Render step. If you try running the app, it will currently crash with the following error: Resource requested by game_of_life_sim::pipeline::queue_bind_group does not exist: game_of_life_sim::image::GameOfLifeImage Oops! We forgot to tell bevy render world how to access our Image which exist on the main world. Let's add the ExtractResourcePlugin which just extracts the resources into the "render world". app.add_plugin(FrameTimeDiagnosticsPlugin::default()) // Extract the game of life image resource from the main world into the render world // for operation on by the compute shader and display on the sprite. .add_plugin(ExtractResourcePlugin::<GameOfLifeImage>::default()) ... If you run again, no errors! Awesome :D. Now onto nodes and the render graph. This was new to me after I setup wgpu manually in my other projects. If you are curious, this is the docstring attached to the RenderGraph resource: The RenderGraph configures the modular, parallel and re-usable render logic. It is a retained and stateless (nodes themselves may have their own internal state) structure, which can not be modified while it is executed by the graph runner. The RenderGraphRunner is responsible for executing the entire graph each frame. It consists of three main components: Nodes, Edges and Slots. Nodes are responsible for generating draw calls and operating on input and output slots. Edges specify the order of execution for nodes and connect input and output slots together. Slots describe the render resources created or used by the nodes. Additionally a render graph can contain multiple sub graphs, which are run by the corresponding nodes. Every render graph can have its own optional input node. Essentially we setup a graph to tell the render world how to run our pipelines. We only have a single pipeline currently, so we will only need a single node. Our node will have a state for processing which stage the shader is currently in: Loading, Init, Update. Back in pipeline.rs lets add our node: ...
pub enum GameOfLifeState { Loading, Init, Update,
} pub struct GameOfLifeNode { state: GameOfLifeState,
} impl Default for GameOfLifeNode { fn default() -> Self { Self { state: GameOfLifeState::Loading, } }
} Lets add the node to our render app: let render_app = app.sub_app_mut(RenderApp);
render_app .init_resource::<GameOfLifePipeline>() .add_system(pipeline::queue_bind_group.in_set(RenderSet::Queue)); let mut render_graph = render_app.world.resource_mut::<RenderGraph>();
render_graph.add_node("game_of_life", GameOfLifeNode::default());
render_graph.add_node_edge( "game_of_life", bevy::render::main_graph::node::CAMERA_DRIVER,
); We add the node to the render graph and then add an edge to the camera driver. This will tell the render graph to run our node before the camera driver. Our node starts in the Loading state. We now have to impl bevy's render_graph::Node: The trait is defined as follow: pub trait Node: Downcast + Send + Sync + 'static { /// Specifies the required input slots for this node. /// They will then be available during the run method inside the [`RenderGraphContext`]. fn input(&self) -> Vec<SlotInfo> { Vec::new() } /// Specifies the produced output slots for this node. /// They can then be passed one inside [`RenderGraphContext`] during the run method. fn output(&self) -> Vec<SlotInfo> { Vec::new() } /// Updates internal node state using the current render [`World`] prior to the run method. fn update(&mut self, _world: &mut World) {} /// Runs the graph node logic, issues draw calls, updates the output slots and /// optionally queues up subgraphs for execution. The graph data, input and output values are /// passed via the [`RenderGraphContext`]. fn run( &self, graph: &mut RenderGraphContext, render_context: &mut RenderContext, world: &World, ) -> Result<(), NodeRunError>;
} The input defines required input slots and output defines produced output slots. This will exist on the RenderGraphContext. Our example doesn't use either, so we don't care for the graph context. impl render_graph::Node for GameOfLifeNode { fn update(&mut self, world: &mut World) { let pipeline = world.resource::<GameOfLifePipeline>(); let pipeline_cache = world.resource::<PipelineCache>(); // if the corresponding pipeline has loaded, transition to the next stage match self.state { GameOfLifeState::Loading => { if let CachedPipelineState::Ok(_) = pipeline_cache.get_compute_pipeline_state(pipeline.init_pipeline) { self.state = GameOfLifeState::Init; } } GameOfLifeState::Init => { if let CachedPipelineState::Ok(_) = pipeline_cache.get_compute_pipeline_state(pipeline.update_pipeline) { self.state = GameOfLifeState::Update; } } GameOfLifeState::Update => {} } } fn run( &self, _graph: &mut render_graph::RenderGraphContext, render_context: &mut RenderContext, world: &World, ) -> Result<(), render_graph::NodeRunError> { Ok(()) }
} Lets focus on the update method. We are checking if the pipeline has loaded. If it has, we transition to the next stage. For update, we have no other state to transition to, but if you needed to recreate your pipeline or rerun your init pipeline, you would do change the state here. The fun stuff: run. This is where we will be running our compute shaders. Let's setup the init pipeline first: fn run( &self, _graph: &mut render_graph::RenderGraphContext, render_context: &mut RenderContext, world: &World, ) -> Result<(), render_graph::NodeRunError> { let texture_bind_group = &world.resource::<GameOfLifeImageBindGroup>().0; let pipeline_cache = world.resource::<PipelineCache>(); let pipeline = world.resource::<GameOfLifePipeline>(); ... We have to pull 3 resources from the world: GameOfLifeImageBindGroup, PipelineCache, and GameOfLifePipeline. We are already familiar with the pipeline and pipeline cache, but the new resource GameOfLifeImageBindGroup is a BindGroup that we queue each frame to be used by the shader. Now we begin the ComputePass. ...
let mut pass = render_context .command_encoder() .begin_compute_pass(&ComputePassDescriptor::default());
... Since we are only using compute shaders, we need to begin a compute pass, the other side of the coin is a render pass for vertex and fragment shaders. ...
pass.set_bind_group(0, texture_bind_group, &[]);
... Assign our bindgroup the the compute pass. Then we pull the state defined from our node to see which piplline to execute. // select the pipeline based on the current state
match self.state { GameOfLifeState::Update | GameOfLifeState::Loading => {} GameOfLifeState::Init => { let init_pipeline = pipeline_cache .get_compute_pipeline(pipeline.init_pipeline) .unwrap(); pass.set_pipeline(init_pipeline); pass.dispatch_workgroups( SIM_SIZE.0 / WORKGROUP_SIZE, SIM_SIZE.1 / WORKGROUP_SIZE, 1, ); }
} We are skipping the update pipeline currently, but we will come back to it. For the init state, we want to run the init pipeline. We set the pipeline using our CachedComputePipelineId defined in our GameOfLifePipeline. Then we dispatch the workgroups. The function takes 3 arguments: x, y, z. In our shader, we defined our workgroup size as 8x8x1. @compute @workgroup_size(8, 8, 1) A visual representation of work groups: Work Groups . It may be helpful to think of a compute shader as a function that is run in a bunch of nested for loops, but each loop is executed in parallel. It would look something like this: for wgx in num_workgroups.x: for wgy in num_workgroups.y: for wgz in num_workgroups.z: var local_invocation_id = (wgx, wgy, wgz) for x in workgroup_size.x: for y in workgroup_size.x: for z in workgroup_size.x: Running still produces the same black screen, but I promise the init pipeline triggered once, we just need to add code to our shader now! Bevy uses wgpu internally, which uses wgsl as their default shader language. They also support GLSL, but a word of warning, there can be some weird quirks when using GLSL with wgpu. To start with our init function in our shader, we see some function inputs: fn init(@builtin(global_invocation_id) invocation_id: vec3<u32>, @builtin(num_workgroups) num_workgroups: vec3<u32>) This is a builtin value for the current invocation’s global invocation ID, i.e. its position in the compute shader grid. WGSL has many builtin values and functions. Please refer to the spec for more info WebGPU Shading Language . And the num_workgroups is the number of workgroups in each dimension. fn init(@builtin(global_invocation_id) invocation_id: vec3<u32>, @builtin(num_workgroups) num_workgroups: vec3<u32>) { let location = vec2<i32>(invocation_id.xy);
} We can get the current location within the shader by casting the invocation.xy to an i32. invocation.xy is short hand for invocation.x and invocation.y We want to randomize our initial state, so lets define a random function. fn hash(value: u32) -> u32 { var state = value; state = state ^ 2747636419u; state = state * 2654435769u; state = state ^ state >> 16u; state = state * 2654435769u; state = state ^ state >> 16u; state = state * 2654435769u; return state;
} fn randomFloat(value: u32) -> f32 { return f32(hash(value)) / 4294967295.0;
} There are many hash / random functions you can find online. Each with their own pros and cons. I am just using the bevy default. 2654435769u is a inline cast like in rust with 2654435769_u32. The u is for u32. let randomNumber = randomFloat(invocation_id.y * num_workgroups.x + invocation_id.x);
let alive = randomNumber > 0.9; We generate a random number, and if it is greater than 0.9, we set the cell to alive. We can now set the cell in our texture. Play around with what denotes and alive cell. Lowering 0.9 will generate more alive cells and vice versa. Lets finish off the init. fn init(@builtin(global_invocation_id) invocation_id: vec3<u32>, @builtin(num_workgroups) num_workgroups: vec3<u32>) { let location = vec2<i32>(invocation_id.xy); let randomNumber = randomFloat(invocation_id.y * num_workgroups.x + invocation_id.x); let alive = randomNumber > 0.9; let color = vec4<f32>(f32(alive)); textureStore(texture, location, color);
} You might be curious what vec4<f32>(f32(alive)) is doing here. vec4<f32>() is casting the value to a vec4<f32>. We are using the f32() function to cast the alive value from a bool to a f32. So if alive the color will be vec4<f32>(1.0) or (1.0,1.0,1.0,1.0) and if dead vec4<f32>(0.0) or (0.0,0.0,0.0,0.0). And now the moment of truth, we can run our code and see the results! Running should produce something like this: Game of life Code can be found on github: Part 2

8.body:
It is exciting to finally see some progress after so much boilerplate! Let's change up the color scheme a bit! I like the color red, so let's make the alive cells red. In our shader, switch the init_pipeline color to the following: @compute @workgroup_size(8, 8, 1)
fn init(@builtin(global_invocation_id) invocation_id: vec3<u32>, @builtin(num_workgroups) num_workgroups: vec3<u32>) { let location = vec2<i32>(invocation_id.xy); let randomNumber = randomFloat(invocation_id.y * num_workgroups.x + invocation_id.x); let alive = randomNumber > 0.9; let color = vec4<f32>(f32(alive), 0.0, 0.0, 1.0); // NEW textureStore(texture, location, color);
} And you should see something like this: Game of life red Very red! Now onto our update pipeline, which makes all this worth it to see the cells move.

9.body:
Back in pipeline.rs lets update our match statement within the run function of our node. // select the pipeline based on the current state
match self.state { GameOfLifeState::Loading => {} GameOfLifeState::Init => { let init_pipeline = pipeline_cache .get_compute_pipeline(pipeline.init_pipeline) .unwrap(); pass.set_pipeline(init_pipeline); pass.dispatch_workgroups( SIM_SIZE.0 / WORKGROUP_SIZE, SIM_SIZE.1 / WORKGROUP_SIZE, 1, ); } GameOfLifeState::Update => { let update_pipeline = pipeline_cache .get_compute_pipeline(pipeline.update_pipeline) .unwrap(); pass.set_pipeline(update_pipeline); pass.dispatch_workgroups( SIM_SIZE.0 / WORKGROUP_SIZE, SIM_SIZE.1 / WORKGROUP_SIZE, 1, ); }
} It is exactly the same as the init pipeline, we just use the update pipeline instead. That takes care of the rust side of things, now onto the shader.
